INSERT INTO `wp_posts` VALUES (1,1,'2018-05-03 10:00:31','2018-05-03 10:00:31','Welcome to WordPress. This is your first post. Edit or delete it, then start writing!','Hello world!','','publish','open','open','','hello-world','','','2018-05-03 10:00:31','2018-05-03 10:00:31','',0,'http://commonsbooking.localhost/?p=1',0,'post','',1),(2,1,'2018-05-03 10:00:31','2018-05-03 10:00:31','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://commonsbooking.localhost/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Sample Page','','publish','closed','open','','sample-page','','','2018-05-03 10:00:31','2018-05-03 10:00:31','',0,'http://commonsbooking.localhost/?page_id=2',0,'page','',0),(4,1,'2018-05-03 10:00:46','2018-05-03 10:00:46','Cargonomia','Cargonomia','','publish','open','open','','cargonomia','','','2018-05-03 10:00:46','2018-05-03 10:00:46','',0,'http://commonsbooking.localhost/?p=4',0,'location','',0),(5,1,'2018-05-03 10:00:46','2018-05-03 10:00:46','Bicyclev\r\n\r\n&nbsp;\r\n\r\n[contact-form-7 id=\"79\" title=\"booking form\"]','Bicycle','','publish','open','open','','bicycle','','','2018-07-16 15:25:02','2018-07-16 15:25